        <p> Hello </p>
      </header>
    </div>
  );
}*/



class App extends Component {
	render() {
		return (
			<div className="App">
			    <div className="App-bkgd">
	      			<header className="App-header">
	      			<div id="App-header-container">
	      				<p position='relative' z-index='1'>  Ishita Korde <Circle r={30} fill={{color:'#545b94'}} position='relative' z-index='0'> </Circle> </p>
		        			<div classname="App-header-circle" >  

		        			</div> 
	        			</div>
	       	 			<p className="sidebar-main" > <Sidebar> </Sidebar> </p>
	      			</header>
      			</div>
    		</div>

		)
	}
}

export default App;
